import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

import "../style/home-view.css";

const Home = () => {
  return (
    <Container>
      <Row>
        <Col
          sm={{ span: 12, order: 1 }}
          md={{ span: 8, order: 2 }}
          className=" home-banner banner-image"
        >
          <img
            src="https://aish.s3.eu-west-2.amazonaws.com/public/files/uploads/2aa94323e32e0c7612ff68ac031b92f47a2965de.png"
            alt="img of pug in pink circle"
          />
        </Col>
        <Col
          sm={{ span: 12, order: 2 }}
          md={{ span: 4, order: 1 }}
          className="align-items-center justify-content-center home-banner banner-header"
        >
          Find your dream Pet here
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
